


 
n = p*q
e = 65537
from Crypto.PublicKey import RSA
priKey = RSA.construct((n, e, pow(e,-1,(p-1)*(q-1)),p,q))
from Crypto.Cipher import PKCS1_v1_5


cipher = PKCS1_v1_5.new(priKey)

c = open("ciphertext","rb")
flag=c.read()
c.close()


ciphertext = cipher.decrypt(flag,sentinel=0)

print(ciphertext)